from odoo import http
from odoo.http import request
from . import company, api, user


class DTIDController(http.Controller):

    @http.route('/get/qrcode', auth='user', type='json')
    def _get_qr_code(self):
        env = request.env
        is_admin = env.is_admin()
        if is_admin:
            result = company.get_qr_code()
            if result.status_code == api.HTTP_OK:
                api_result = api.parser(result.json())
                if api_result.code == api.SUCCESS:
                    return api_result.payload
        else:
            payload = user.get_applet_code()
            if payload is None:
                return {
                    "qrId": "xxx",
                    "qrImage": ""
                }
            else:
                return {
                    "qrId": payload['qid'],
                    "qrImage": payload['serverUrl'] + "/" + payload['qid']
                }

    @http.route('/get/scan', auth='user', type='json')
    def _get_qr_scan(self, qrId):
        env = request.env
        is_admin = env.is_admin()
        if is_admin:
            resp = company.scan_code_result(qrId)
            if resp.status_code == api.HTTP_OK:
                return resp.json()
        else:
            resp = user.get_scan_code_result(qrId)
            if resp.status_code == api.HTTP_OK:
                return resp.json()
